import React from 'react'
import '.mypro';
import { Row, Col, Container } from 'react-bootstrap';

function Myprojects() {
  return (
    <div>
      <Container>
        <Row className="carousel">
          <Col className="item">box-1</Col>
          <Col className="item">box-1</Col>
          <Col className="item">box-1</Col>
          <Col className="item">box-1</Col>
          <Col className="item">box-1</Col>
          <Col className="item">box-1</Col>
        </Row>
      </Container>
    </div>
  )
}

export default Myprojects;
